import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Redirect,
} from "react-router-dom";

import Home from './app/Home/Home';
import LandingPage from './app/Login/LandingPage';

function App(props) {
    
    const auth_token = localStorage.getItem('authtoken');
    const userData = JSON.parse(localStorage.getItem('userData'));

    console.log("userData", JSON.parse(userData));
    console.log("token", auth_token);
    console.log("I found", auth_token !== null && JSON.parse(userData) !== null);
    
    return (
        <>
            {/* <LoadingBar style={{ background: "#E5017D", zIndex: 99, position: "fixed"}} /> */}
            <Router>
                { auth_token !== null && userData !== null  ? <Redirect to="/home/pages" /> : <Redirect to="/" /> }
                <Switch>
                        <Route path="/">
                            <LandingPage />
                        </Route>

                        <Route path="/home">
                            <Home />
                        </Route>
                    
                    {/* <Route path="/dachboard">
                        {
                            localStorage.getItem("authtoken") ?
                                <Dachboard />
                                :
                                <Redirect to="/" />

                        }
                    </Route>


                    <Route path="/">
                        {localStorage.getItem("authtoken") ?
                            <Redirect to="/dachboard" />
                            :
                            <LandingPage />
                        }
                    </Route> */}

                </Switch>
            </Router>
        </>
    )
}

export default App;
